import React, { useContext } from 'react';
import { AuthContext } from '../context/AuthContext';

const ProfilePage = () => {
    const { user } = useContext(AuthContext);

    return (
        <div>
            <h1>Profile</h1>
            <p>Email: {user?.email}</p>
            <p>Name: John Doe</p>
            <p>Registered Events: Event 1, Event 2</p>
        </div>
    );
};

export default ProfilePage;
